import { useHistory } from 'react-router-dom';
import { useState, useEffect, useMemo } from 'react';
import { connect } from 'react-redux';
import { myOrderthunk } from "../reduxstore/thunk"

 function Myorders(props) {
    const history = useHistory();

    useEffect(() => {
        props.dispatch(myOrderthunk())   
    }, [])
    function shopping() {
        history.push("/")
    }
    return(
        <>
        <div className=" bg-light rounded px-5 py-4 mt-5 shadow" style={{ width: "50%", margin: "auto" }}>
            <h3>YOUR ORDERS</h3>
            <div className="bg-white p-lg-5 p-2 rounded cart_itm_details_container">
                                <div className="d-flex border-bottom py-3 justify-content-between align-items-center  ">
                                    <div className="flex-grow-1">
                                        <h1 style={{ fontSize: "1.6rem" }}>Shopping Cart</h1>

                                    </div>
                                    <div>
                                        <h6>{props.cartcakeslist.length} items</h6>
                                    </div>
                                </div>
                                {cakeitemlist.length === 0 &&
                                    <h4 style={{ color: "RED" }}>Your cart is empty</h4>}
                                {cakeitemlist}

                            </div>
            <button onClick={shopping} type="submit" className="btn btn-primary mt-3">CONTINUE SHOPPING</button>
        </div>
        </>
    )
    
}
export default connect(function (state, props) {
    return {
        myordercakes: state["myOrderreducer"]["myordercakes"] || []
    } 
})(Myorders)
